import React, { useState } from 'react';
import {
  SafeAreaView,
  View,
  Text,
  Image,
  StyleSheet,
  TextInput,
  ScrollView,
  TouchableOpacity,
} from 'react-native';

const App = () => {
  const [isEditing, setIsEditing] = useState(false); // Toggle between edit and view mode
  const [profile, setProfile] = useState({
    username: 'Chidoy',
    name: 'Chidoy',
    followers: 3057,
    following: 278,
    collections: 52,
    birthday: '2000-10-21',
    email: 'urbinajohnriel@gmail.com',
    phoneNumber: '+82 95 5808 2654',
    website: 'www.chidoy.com',
  });

  // Handle input change during editing
  function handleInputChange(field, value) {
    setProfile({ ...profile, [field]: value });
  }

  // Toggle between view and edit mode
  const handleEditToggle = () => {
    setIsEditing(!isEditing);
  };

  return (
    <SafeAreaView style={styles.container}>
      <ScrollView contentContainerStyle={styles.scrollView}>
        {/* Background Header */}
        <View style={styles.header}>
          <View style={styles.overlay} />
          <Image
            source={{
              uri: 'data:image/jpeg;base64,', // replace with your background image URL
            }}
            style={styles.backgroundImage}
          />
          <View style={styles.profileImageContainer}>
            <Image
              source={{
                uri: 'data:image/jpeg;base64,', // replace with your profile image URL
              }}
              style={styles.profileImage}
            />
          </View>
        </View>

        {/* Profile Information */}
        <View style={styles.profileDetails}>
          {/* Stats */}
          <View style={styles.statsContainer}>
            <View style={styles.stat}>
              <Text style={styles.statNumber}>{profile.followers}</Text>
              <Text style={styles.statLabel}>Followers</Text>
            </View>
            <View style={styles.stat}>
              <Text style={styles.statNumber}>{profile.following}</Text>
              <Text style={styles.statLabel}>Following</Text>
            </View>
            <View style={styles.stat}>
              <Text style={styles.statNumber}>{profile.collections}</Text>
              <Text style={styles.statLabel}>Collections</Text>
            </View>
          </View>

          {/* Contact Information */}
          {isEditing ? (
            <View style={styles.editForm}>
              <TextInput
                style={styles.input}
                value={profile.name}
                onChangeText={(text) => handleInputChange('name', text)}
                placeholder="Full Name"
              />
              <TextInput
                style={styles.input}
                value={profile.birthday}
                onChangeText={(text) => handleInputChange('birthday', text)}
                placeholder="Birthday (YYYY-MM-DD)"
              />
              <TextInput
                style={styles.input}
                value={profile.email}
                onChangeText={(text) => handleInputChange('email', text)}
                placeholder="Email"
                keyboardType="email-address"
              />
              <TextInput
                style={styles.input}
                value={profile.phoneNumber}
                onChangeText={(text) => handleInputChange('phoneNumber', text)}
                placeholder="Phone Number"
                keyboardType="phone-pad"
              />
              <TextInput
                style={styles.input}
                value={profile.website}
                onChangeText={(text) => handleInputChange('website', text)}
                placeholder="Website"
                keyboardType="url"
              />
            </View>
          ) : (
            <View style={styles.contactInfo}>
              <Text style={styles.contactText}>Name: {profile.name}</Text>
              <Text style={styles.contactText}>Birthday: {profile.birthday}</Text>
              <Text style={styles.contactText}> {profile.email}</Text>
              <Text style={styles.contactText}> {profile.phoneNumber}</Text>
              <Text style={styles.contactText}> {profile.website}</Text>
            </View>
          )}

          {/* Edit/Save Button */}
          <TouchableOpacity style={styles.editButton} onPress={handleEditToggle}>
            <Text style={styles.editButtonText}>{isEditing ? 'Save' : 'Edit Profile'}</Text>
          </TouchableOpacity>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

const COLORS = {
  primary: '#013220', // Pink color theme
  textPrimary: '#333',
  textSecondary: '#888',
  white: '#EDEEE7',
  background: '#294D61',
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: COLORS.background,
  },
  scrollView: {
    justifyContent: 'center',
    alignItems: 'center',
  },
  header: {
    width: '100%',
    height: 250,
    position: 'relative',
    justifyContent: 'center',
    alignItems: 'center',
  },
  backgroundImage: {
    width: '100%',
    height: '100%',
    resizeMode: 'cover',
    position: 'absolute',
  },
  overlay: {
    backgroundColor: COLORS.primary,
    opacity: 0.6,
    width: '100%',
    height: '100%',
    position: 'absolute',
  },
  profileImageContainer: {
    position: 'absolute',
    bottom: -60, // Offset to make the profile image overlap the header
    width: 120,
    height: 120,
    borderRadius: 60,
    borderWidth: 5,
    borderColor: COLORS.white,
    overflow: 'hidden',
  },
  profileImage: {
    width: '100%',
    height: '100%',
    borderRadius: 60,
  },
  profileDetails: {
    marginTop: 70, // Offset to align after the profile image
    backgroundColor: COLORS.white,
    paddingHorizontal: 20,
    paddingVertical: 20,
    borderRadius: 15,
    width: '90%',
    alignItems: 'center',
  },
  statsContainer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    width: '100%',
    marginBottom: 20,
  },
  stat: {
    alignItems: 'center',
  },
  statNumber: {
    fontSize: 22,
    fontWeight: 'bold',
    color: COLORS.textPrimary,
  },
  statLabel: {
    fontSize: 14,
    color: COLORS.textSecondary,
  },
  contactInfo: {
    alignItems: 'flex-start',
    marginBottom: 20,
  },
  contactText: {
    fontSize: 16,
    color: COLORS.textPrimary,
    marginVertical: 5,
  },
  editForm: {
    width: '100%',
  },
  input: {
    width: '100%',
    height: 40,
    backgroundColor: '#f2f2f2',
    borderColor: '#ccc',
    borderWidth: 1,
    borderRadius: 8,
    paddingHorizontal: 10,
    marginBottom: 10,
  },
  editButton: {
    backgroundColor: COLORS.primary,
    paddingVertical: 8,
    paddingHorizontal: 30,
    borderRadius: 25,
    marginTop: 20,
  },
  editButtonText: {
    color: COLORS.white,
    fontSize: 16,
    fontWeight: 'bold',
  },
});

export default App;
